  return (
    <div className={`message-other-container ${lightTheme ? '' : 'dark'}`}>
        <div className='text-content'>
        <p className='conversation-lastMessage'>{props1.message}</p>
        <p className='self-time'>12:00am</p>
        </div>
    </div> 

  )
}

export default MessageOthers
